// SPDX-License-Identifier: MIT
pragma solidity ^0.8.18;

// Use OpenZeppelin's Ownable for simple, secure access control.
// import "@openzeppelin/contracts/access/Ownable.sol";

contract EthBridge{
    event TokensLocked(address indexed userAddress, uint256 amount);

    // constructor (address initialOwner)

    function lock() external payable {
        require(msg.value > 0,"Amount must be greater than 0");
        emit TokensLocked(msg.sender, msg.value);
    }

    ////// END of first contract on ethereum blockchain ///////
}

